import React from 'react';
import Layout from './Components/Layout/Layout';
import './App.css';
import OrderBuilder from './Container/OrderBuilder/OrderBuilder';
import {Route} from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Layout>
          <Route path="/" component={OrderBuilder} />
      </Layout>
    </div>
  );
}

export default App;
